INSERT INTO `agriculture_germplasm` (`germplasm_id`, `crop_name`, `crop_en_name`, `germplasm_name`, `germplasm_en_name`, `germplasm_img`, `germplasm_des`, `remark`, `status`, `order_num`, `create_by`, `create_time`, `update_by`, `update_time`, `del_flag`) VALUES (1, '西瓜', 'watermelon', '西瓜', 'watermelon', '/profile/iot/1/2023-0803-095310.png', '西瓜是一种夏季消暑的好选择，其含有丰富的水分和天然的清凉成分，能够有效地降低体温。除了降热解暑，西瓜皮还可以用来炒着吃或伴着吃，制成药材来治疗肾炎水肿、肝病黄疸等疾病，甚至可以作为美容材料用来敷脸。因此，夏季食用西瓜不仅能够解暑，还能保持身体健康。', '1', '0', 0, 1, '2023-05-18 09:35:37', 1, '2023-08-03 09:53:12', '0');
INSERT INTO `agriculture_germplasm` (`germplasm_id`, `crop_name`, `crop_en_name`, `germplasm_name`, `germplasm_en_name`, `germplasm_img`, `germplasm_des`, `remark`, `status`, `order_num`, `create_by`, `create_time`, `update_by`, `update_time`, `del_flag`) VALUES (2, '番茄', 'tomato', '番茄', 'tomato', '/profile/iot/1/2023-0803-095406.png', '1212', '', '0', 0, 1, '2023-05-23 21:01:12', 1, '2023-08-03 09:54:08', '0');
INSERT INTO `agriculture_germplasm` (`germplasm_id`, `crop_name`, `crop_en_name`, `germplasm_name`, `germplasm_en_name`, `germplasm_img`, `germplasm_des`, `remark`, `status`, `order_num`, `create_by`, `create_time`, `update_by`, `update_time`, `del_flag`) VALUES (3, '胡萝卜', 'carrot', '胡萝卜', 'carrot', '/profile/iot/1/2023-0803-095052.png', '胡萝卜（Daucus carota var. sativa Hoffm.），是伞形科胡萝卜属一年生或二年生草本植物。转基因胡萝卜：表面较光滑。胡萝卜根肉质，长圆锥形，呈橙红色或黄色；茎单生，全株被白色粗硬毛；叶片长圆形，先端尖锐；茎生叶近无柄，有叶鞘，末回裂片小或细长；花通常白色，有时带淡红色；花柄不等长；', '', '0', 0, 1, '2023-08-03 09:51:18', 0, NULL, '0');
