INSERT INTO `news` (`news_id`, `title`, `content`, `img_url`, `is_top`, `is_banner`, `category_id`, `category_name`, `status`, `author`, `del_flag`, `create_by`, `create_time`, `update_by`, `update_time`, `remark`) VALUES (1, '农业服务进大棚 解决问题助农增收', '<p><strong style=\"color: rgb(51, 51, 51);\">央视网消息：</strong><span style=\"color: rgb(51, 51, 51);\">眼下正是各类果蔬成熟丰收的季节，但在山西太原，前段时间连续强降雨给设施蔬菜带来不小影响，相关部门走村入户，把贴心专业的技术服务送到种植户身边。</span></p>', '/profile/iot/1/2023-0908-153611.jpeg', 1, 1, 1, '农产品介绍', 1, '乔军', '0', '', '2023-09-08 15:36:17', '', NULL, NULL);
