INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (985, '种质', 1, 'com.ruoyi.agriculture.controller.GermplasmController.add()', 'POST', 1, 'admin', NULL, '/agriculture/germplasm', '127.0.0.1', '内网IP', '{\"germplasmImg\":\"/profile/iot/1/2023-0803-095052.png\",\"germplasmEnName\":\"carrot\",\"cropName\":\"胡萝卜\",\"germplasmId\":3,\"cropEnName\":\"carrot\",\"germplasmName\":\"胡萝卜\",\"params\":{},\"germplasmDes\":\"胡萝卜（Daucus carota var. sativa Hoffm.），是伞形科胡萝卜属一年生或二年生草本植物。转基因胡萝卜：表面较光滑。胡萝卜根肉质，长圆锥形，呈橙红色或黄色；茎单生，全株被白色粗硬毛；叶片长圆形，先端尖锐；茎生叶近无柄，有叶鞘，末回裂片小或细长；花通常白色，有时带淡红色；花柄不等长；\",\"createBy\":\"1\",\"createTime\":1691027477997,\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2023-08-03 09:51:18');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (986, '种质', 2, 'com.ruoyi.agriculture.controller.GermplasmController.edit()', 'PUT', 1, 'admin', NULL, '/agriculture/germplasm', '127.0.0.1', '内网IP', '{\"germplasmImg\":\"/profile/iot/1/2023-0518-102524.png\",\"germplasmEnName\":\"watermelon\",\"cropName\":\"西瓜\",\"germplasmId\":1,\"cropEnName\":\"watermelon\",\"germplasmName\":\"西瓜\",\"orderNum\":0,\"remark\":\"1\",\"updateTime\":1691027539539,\"delFlag\":\"0\",\"params\":{},\"germplasmDes\":\"西瓜是一种夏季消暑的好选择，其含有丰富的水分和天然的清凉成分，能够有效地降低体温。除了降热解暑，西瓜皮还可以用来炒着吃或伴着吃，制成药材来治疗肾炎水肿、肝病黄疸等疾病，甚至可以作为美容材料用来敷脸。因此，夏季食用西瓜不仅能够解暑，还能保持身体健康。\",\"createBy\":\"1\",\"createTime\":1684373737000,\"updateBy\":\"1\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2023-08-03 09:52:19');
