  `id` varchar(32) DEFAULT NULL COMMENT '物模型标识符',
  `name` varchar(64) DEFAULT NULL COMMENT '物模型名称',
  `value` varchar(64) DEFAULT NULL COMMENT '物模型值',
  `operator` varchar(8) DEFAULT NULL COMMENT '操作符',
  `type` tinyint(1) DEFAULT NULL COMMENT '物模型类别（1=属性，2=功能，3=事件，4=设备升级，5=设备上线，6=设备下线）',
  `product_id` bigint(20) DEFAULT NULL COMMENT '产品ID',
