  `job_id` bigint(20) DEFAULT NULL COMMENT '任务ID',
  `cron_expression` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT 'cron执行表达式',
  `is_advance` tinyint(1) DEFAULT NULL COMMENT '是否详细corn表达式（1=是，0=否）',
