  `tenant_id` bigint(20) NOT NULL COMMENT '租户ID',
  `tenant_name` varchar(30) NOT NULL DEFAULT '' COMMENT '租户名称',
  `is_sys` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否系统通用（0-否，1-是）',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父级ID',
  `order_num` int(4) DEFAULT NULL COMMENT '显示顺序',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`category_id`) USING BTREE,
  KEY `iot_category_index_tenant_id` (`tenant_id`) USING BTREE,
  KEY `iot_category_index_parent_id` (`parent_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='产品分类';

-- ----------------------------
-- Records of iot_category
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for iot_device
-- ----------------------------
DROP TABLE IF EXISTS `iot_device`;
CREATE TABLE `iot_device` (
  `device_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '设备ID',
  `device_name` varchar(64) NOT NULL COMMENT '设备名称',
  `product_id` bigint(20) NOT NULL COMMENT '产品ID',
  `product_name` varchar(64) NOT NULL COMMENT '产品名称',
  `land_id` bigint(20) NOT NULL DEFAULT '0',
  `land_name` varchar(50) NOT NULL DEFAULT '',
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `user_name` varchar(30) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `tenant_id` bigint(20) NOT NULL COMMENT '租户ID',
  `tenant_name` varchar(30) NOT NULL DEFAULT '' COMMENT '租户名称',
  `serial_number` varchar(64) NOT NULL COMMENT '设备编号',
  `firmware_version` float(11,2) NOT NULL COMMENT '固件版本',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '设备状态（1-未激活，2-禁用，3-在线，4-离线）',
  `rssi` tinyint(11) DEFAULT NULL COMMENT '信号强度（\r\n信号极好4格[-55— 0]，\r\n信号好3格[-70— -55]，\r\n信号一般2格[-85— -70]，\r\n信号差1格[-100— -85]）',
  `is_shadow` tinyint(1) DEFAULT NULL COMMENT '是否启用设备影子(0=禁用，1=启用)',
  `location_way` tinyint(1) DEFAULT NULL COMMENT '定位方式(1=ip自动定位，2=设备定位，3=自定义)',
  `things_model_value` json DEFAULT NULL COMMENT '物模型值',
  `network_address` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '设备所在地址',
  `network_ip` varchar(32) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '设备入网IP',
  `longitude` double(11,6) DEFAULT NULL COMMENT '设备经度',
  `latitude` double(11,6) DEFAULT NULL COMMENT '设备纬度',
  `active_time` datetime DEFAULT NULL COMMENT '激活时间',
  `summary` json DEFAULT NULL COMMENT '设备摘要，格式[{"name":"device"},{"chip":"esp8266"}]',
  `img_url` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`device_id`) USING BTREE,
  UNIQUE KEY `iot_device_index_serial_number` (`serial_number`) USING BTREE,
  KEY `iot_device_index_product_id` (`product_id`) USING BTREE,
  KEY `iot_device_index_tanant_id` (`tenant_id`) USING BTREE,
  KEY `iot_device_index_user_id` (`user_id`) USING BTREE,
  KEY `iot_device_index_create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='设备';

-- ----------------------------
-- Records of iot_device
-- ----------------------------
BEGIN;
COMMIT;

