-- ----------------------------
-- Table structure for iot_device_job
-- ----------------------------
DROP TABLE IF EXISTS `iot_device_job`;
CREATE TABLE `iot_device_job` (
  `job_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '任务ID',
  `job_name` varchar(64) NOT NULL DEFAULT '' COMMENT '任务名称',
  `job_group` varchar(64) NOT NULL DEFAULT 'DEFAULT' COMMENT '任务组名',
  `cron_expression` varchar(255) DEFAULT '' COMMENT 'cron执行表达式',
  `misfire_policy` varchar(20) DEFAULT '3' COMMENT '计划执行错误策略（1立即执行 2执行一次 3放弃执行）',
  `concurrent` char(1) DEFAULT '1' COMMENT '是否并发执行（0允许 1禁止）',
  `status` char(1) DEFAULT '0' COMMENT '状态（0正常 1暂停）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT '' COMMENT '备注信息',
  `device_id` bigint(20) DEFAULT NULL COMMENT '设备ID',
  `serial_number` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '设备编号',
  `device_name` varchar(64) DEFAULT NULL COMMENT '设备名称',
  `is_advance` tinyint(1) DEFAULT NULL COMMENT '是否详细corn表达式（1=是，0=否）',
  `actions` json DEFAULT NULL COMMENT '执行的动作集合',
  `job_type` tinyint(1) DEFAULT NULL COMMENT '任务类型（1=设备定时，2=设备告警，3=场景联动）',
  `product_id` bigint(20) DEFAULT NULL COMMENT '产品ID',
  `product_name` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '产品名称',
  `scene_id` bigint(20) DEFAULT NULL COMMENT '场景联动ID',
  `alert_id` bigint(20) DEFAULT NULL COMMENT '告警ID',
  `alert_trigger` json DEFAULT NULL COMMENT '定时告警触发器',
  PRIMARY KEY (`job_id`,`job_name`,`job_group`) USING BTREE,
  KEY `iot_device_job_index_device_id` (`device_id`) USING BTREE,
  KEY `iot_device_job_index_product_id` (`product_id`) USING BTREE,
  KEY `iot_device_job_index_scene_id` (`scene_id`) USING BTREE,
  KEY `iot_device_job_index_alert_id` (`alert_id`) USING BTREE,
  KEY `iot_device_job_index_serial_number` (`serial_number`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='设备定时';

-- ----------------------------
-- Records of iot_device_job
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for iot_device_job_log
-- ----------------------------
DROP TABLE IF EXISTS `iot_device_job_log`;
CREATE TABLE `iot_device_job_log` (
  `job_log_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '任务日志ID',
  `job_name` varchar(64) NOT NULL COMMENT '任务名称',
